import { Component } from "react";
import Nav from "./conponents/Nav/Nav.jsx";
import DialogF from "./conponents/Dialogs/Message/DialogF.jsx";
import "./App.css";
import { Route } from "react-router-dom";
import UsersC from "./conponents/New/NewC";
import ProfileC from "./conponents/Profile/ProfileC";
import HeaderC from "./conponents/Header/HeaderC";
import Login from "./Login/login";
import { connect } from "react-redux";
import { Loginauth, VUheader } from "./redux/authPage";

export default class App extends Component {
  render() {
    return (
      <div className="App">
        <HeaderC />
        <Nav />
        <Route path="/dialog" render={() => <DialogF />} />
        <Route path="/profile/:userid?" render={() => <ProfileC />} />
        <Route path="/new" render={() => <UsersC />} />
        <Route path="/login" render={() => <Login />} />
      </div>
    );
  }
}

connect(mapStateToProps, { VUheader, Loginauth })(HeaderC);
